    "2016-10-07T14:52:25.601840",nt"name": "nndss-table-i-infrequently-reported-notifiable-diseases",nt"isopen":
    true,nt"url": null,nt"notes": "<p>NNDSS - Table I. infrequently reported
    notifiable diseases - 2016.  In this Table, provisional* cases of selectedu00e2u0080u00a0
    infrequently reported notifiable diseases (&lt;1,000 cases reported during the preceding
    year) are displayed.<br />nNote:</p>n<p>These are provisional cases of selected
    national notifiable diseases, from the National Notifiable Diseases Surveillance
    System (NNDSS). NNDSS data reported by the 50 states, New York City, the District
    of Columbia, and the U.S. territories are collated and published weekly as numbered
    tables printed in the back of the Morbidity and Mortality Weekly Report (MMWR).
    Cases reported by state health departments to CDC for weekly publication are provisional
    because of ongoing revision of information and delayed reporting.</p>n<p>Case counts
    in these tables are presented as they were published in the MMWR issues. Therefore,
    numbers listed in later MMWR weeks may reflect changes made to these counts as additional
    information becomes available.</p>n<p>u00e2u0080u009cSymbols and footnotes changed
    in week #4, please refer to the MMWR publication for the symbols/footnotes for weeks
    1, 2, and 3u00e2u0080u009d.</p>n<p>Footnote:<br />n-: No reported cases    N: Not
    reportable    NA: Not available NN: Not Nationally Notifiable.  NP:  Nationally
    notifiable but not published.    Cum: Cumulative year-to-date counts.<br />n* Case
    counts for reporting years 2015 and 2016 are provisional and subject to change.
     Data for years 2011 through 2014 are finalized. For further information on interpretation
    of these data, see <a href="http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesSurveillanceData20100927.pdf">http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesS...</a>.<br
    />nu00e2u0080u00a0 This table does not include cases from the U.S. territories.
    Three low incidence conditions, rubella, rubella congenital, and tetanus, are in
    Table II to facilitate case count verification with reporting jurisdictions.<br
    />nu00c2u00a7 Calculated by summing the incidence counts for the current week, the
    2 weeks preceding the current week, and the 2 weeks following the current week,
    for a total of 5 preceding years.  Additional information is available at <a href="http://wwwn.cdc.gov/nndss/document/5yearweeklyaverage.pdf">http://wwwn.cdc.gov/nndss/document/5yearweeklyaverage.pdf</a>.<br
    />nu00c2u00b6 Includes both neuroinvasive and nonneuroinvasive. Updated weekly reports
    from the Division of Vector-Borne Diseases, National Center for Emerging and Zoonotic
    Infectious Diseases (ArboNET Surveillance). Data for West Nile virus are available
    in Table II.<br />n** Not reportable in all reporting jurisdictions. Data from states
    where the condition is not reportable are excluded from this table, except for the
    arboviral diseases and influenza-associated pediatric mortality. Reporting exceptions
    are available at <a href="http://wwwn.cdc.gov/nndss/downloads.html">http://wwwn.cdc.gov/nndss/downloads.html</a>.<br
    />nu00e2u0080u00a0u00e2u0080u00a0 Office of Management and Budget approval of the
    NNDSS Revision #0920-0728 on January 21, 2016, authorized CDC to receive data for
    these conditions. CDC is in the process<br />nof soliciting data for these conditions
    (except Zika virus, congenital infection). CDC and the U.S. states are still modifying
    the technical infrastructure needed to collect and transmit data for Zika virus
    congenital infections.<br />nu00c2u00a7u00c2u00a7 Jamestown Canyon virus and Lacrosse
    virus have replaced California serogroup diseases.<br />nu00c2u00b6u00c2u00b6 Data
    for Haemophilus influenzae (all ages, all serotypes) are available in Table II.<br
    />n***  Please refer to the MMWR publication for weekly updates to the footnote
    for this condition.<br />nu00e2u0080u00a0u00e2u0080u00a0u00e2u0080u00a0 Please refer
    to the MMWR publication for weekly updates to the footnote for this condition.<br
    />nu00c2u00a7u00c2u00a7u00c2u00a7 Data for meningococcal disease (all serogroups)
    are available in Table II.<br />nu00c2u00b6u00c2u00b6u00c2u00b6 Please refer to
    the MMWR publication for weekly updates to the footnote for this condition.<br />n****
    Updated weekly from reports to the Division of STD Prevention, National Center for
    HIV/AIDS, Viral Hepatitis, STD, and TB Prevention.<br />nu00e2u0080u00a0u00e2u0080u00a0u00e2u0080u00a0u00e2u0080u00a0
    Please refer to the MMWR publication for weekly updates to the footnote for this
    condition.<br />nu00c2u00a7u00c2u00a7u00c2u00a7u00c2u00a7 All cases reported have
    occurred in travelers returning from affected areas, with their sexual contacts,
    or infants infected in utero.</p>n",nt"license_title": "Other License Specified",nt"extras":
